import React, { FunctionComponent, useState, useEffect } from 'react';
import User from '../models/user';
import USERS from '../models/mock-user';
import NavBar from '../components/nav-bar';
import { Link } from 'react-router-dom';

const UsersList: FunctionComponent = () => {

  const [users, setUsers] = useState<User[]>([]);

  useEffect(() => {
    setUsers(USERS);
  }, []);

  return (
    <div className="center">
      <NavBar />
      <h1 className="center">Users list</h1>
      <div className="container"> 
        <div className="row"> 
        {users.map(user => (
          <div className="col s6 m4">
          <div className="card horizontal">
            <div className="card-stacked">
              <div className="card-content">
                <p><strong>User name:</strong> {user.username}</p>
                <p><strong>Date naissance:</strong> {user.datenaissance.toString()}</p>
              </div>
            </div>
          </div> 
        </div>
        ))}
        </div>
        <div className="row">
        <Link to={`/user/add/`} className="btn btn-floating halfway-fab waves-effect waves-light">
                    <i className="material-icons">add</i>
                </Link>
        </div>
      </div>
    </div> 
  );
}

export default UsersList;
